import React from "react";
import { Grid } from "@chakra-ui/core";
import Settings from "../components/Dashboard/settings";

function Home() {
  return (
    <Grid
      templateColumns="repeat(3, 1fr)"
      templateRows="repeat(2, 1fr)"
      gap={6}
    >
      <Settings />
      {/* <Production /> */}
      {/* <Branch /> */}
      {/* <Chart /> */}
    </Grid>
  );
}

export default Home;
